import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../css/code.css";
import axios from "axios";
import { Fragment } from "react";
function Code({ id }) {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("/api/codeBlocks")
      .then((res) => {
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      {data.map((code) =>
        code.id === id ? (
          <Fragment key={code.id}>
            <h1>{code.title}</h1>
            <p>{code.testCode}</p>
          </Fragment>
        ) : null
      )}
    </div>
  );
}

export default Code;
